window.bookSummaryJSON = "<p><b>GRAMMY NOMINEE</b></p> <p><b>Audie Award, Humor, 2015</b></p> <p>Amy Poehler is hosting a dinner party and you're invited! Welcome to the audiobook edition of Amy Poehler's <i>Yes Please</i>. The guest list is star-studded with vocal appearances from Carol Burnett, Seth Meyers, Michael Schur, Patrick Stewart, Kathleen Turner, and even Amy's parents - <i>Yes Please</i> is the ultimate audiobook extravaganza. </p> <p>Also included? A one-night-only live performance at Poehler's Upright Citizens Brigade Theater. Hear Amy read a chapter live in front of a young and attractive Los Angeles audience. </p> <p>While listening to <i>Yes Please</i>, you'll laugh, you'll cry, and you'll become convinced that your phone is trying to kill you. Don't miss this collection of stories, thoughts, ideas, lists, and haikus from the mind of one of our most beloved entertainers. Offering Amy's thoughts on everything from her \"too safe\" childhood outside of Boston to her early days in New York City, her ideas about Hollywood and \"the biz\", the demon that looks back at all of us in the mirror, and her joy at being told she has a \"face for wigs\" - <i>Yes Please</i> is chock-full of words, and wisdom, to live by. </p>"; 
